from typing import List


class Solution:
    def minOperations(self, nums: List[int], x: int) -> int:
        lookup1 = {}
        lookup2 = {}
        candidates = []
        prefix_sums = [nums[0]]
        lookup1[nums[0]] = 0
        if nums[0] == x:
            candidates.append(1)
      
        for y in range(1,len(nums)):
            sum = nums[y] + prefix_sums[y-1]
            lookup1[sum] = y
            prefix_sums.append(sum)
            if sum == x:
                candidates.append(y+1)
            
        rev = nums[::-1]
        r_prefix_sums = [rev[0]]
        lookup2[rev[0]] = 0
        if rev[0] == x:
            candidates.append(1)
        for y in range(1,len(nums)):
            sum = rev[y] + r_prefix_sums[y-1]
            lookup2[sum] = y
            r_prefix_sums.append(sum)
            if sum == x:
                candidates.append(y+1)
            
            
        print("setup done ")
        # first try no sum
        for l in range(len(nums)):
            diff = x - prefix_sums[l]
            if diff < 0:
                break 
            try: 
                y = lookup2[diff]
                if (y+l+2 <= len(nums)):
                  candidates.append(y+l+2)
            except:
                continue
        for r in range(len(nums)):
            diff = x - r_prefix_sums[r]
            if diff < 0:
                break 
            try: 
                y = lookup1[diff]
                if (y+r+2 <= len(nums)):
                  candidates.append(y+r+2)
            except:
                continue

        if len(candidates) == 0:
            return -1
        return min(candidates)

